(function(){
    var i,
            ord = stm_document, /* орд документ */
            registrars,
            registratorAssocs = ord.assocs['lecm-document-aspects:registrator-assoc'],
            notification;

    /* раздаем права регистраторам */
    if (registratorAssocs && registratorAssocs.length) {
        registrars = [delegation.getEffectiveEmployee(registratorAssocs[0], 'DA_REGISTRARS')];
    } else {
        registrars = ordStatemachine.getRegistrars("DA_REGISTRARS", ord); /* получение списка регистраторов по документу */
    }
    for(i = 0; i < registrars.length; ++i) {
        statemachine.grandDynamicRoleForEmployee(ord, registrars[i], "DA_REGISTRAR_DYN", task);
    }

    /* рассылаем уведомление */
    notifications.sendNotification({
        recipients: registrars,
        templateCode: 'ORD_REGISTER',
        templateConfig: {
            mainObject: ord
        }
    });
})();

