var doc = bpm_package.children[0];
if (doc) {
    var childrenErrands = errands.getChildErrands(doc.nodeRef.toString());
    var hasOnWaitingExecution = false;
    if (childrenErrands && childrenErrands.length) {
        hasOnWaitingExecution = childrenErrands.some(function(child){
            return child.properties["lecm-statemachine:status"] == "Ожидает исполнения";
        });
    }
    doc.properties["lecm-ord:transit-to-on-execution"] = hasOnWaitingExecution;
    doc.properties["lecm-eds-aspect:child-change-signal-count"] = 0;
    doc.save();
}

(function(){
    var ord = stm_document;
    /*Регистрация*/
    regnumbers.registerDocument(ord, "ORD_NUMBER");
    ord.save();
    /*Отмена документов*/
    var canceldDocAssoc = ord.assocs["lecm-ord:canceled-assoc"];
    if (canceldDocAssoc != null && canceldDocAssoc.length > 0) {
      for (var i = 0; i < canceldDocAssoc.length; i++) {
	  var cancelDoc = canceldDocAssoc[i];
      var cancelDocType = cancelDoc.getTypeShort();
      if (cancelDocType == "lecm-ord:document") {
      	    cancelDoc.properties["lecm-statemachine:status"] = "Отменен";
      } else if (cancelDocType == "lecm-nd:document") {
        var ndStatus = cancelDoc.properties["lecm-statemachine:status"];
        if (ndStatus == "Действует") {
          	cancelDoc.properties["lecm-statemachine:status"] = "Отменен";
        } else {
        	cancelDoc.addAspect("lecm-document-aspects:cancelled");
        }
      }
      cancelDoc.save();

      documentConnection.createConnection(ord, cancelDoc, "cancel", true, true);

      var mainDocDesc = substitude.formatNodeTitle(ord, documentScript.wrapperDocumentLink(ord, "№ {~REGNUM} от {~REGDATE}"));
      var canceledDocDesc = substitude.formatNodeTitle(cancelDoc, documentScript.wrapperDocumentLink(cancelDoc, "№ {~REGNUM} от {~REGDATE}"));

	  businessJournal.log(ord.nodeRef.toString(), "CANCEL_DOCUMENT", "Документ " + mainDocDesc + " отменил документ " + canceledDocDesc, []);
	  businessJournal.log(cancelDoc.nodeRef.toString(), "CANCEL_DOCUMENT",  "Документ " + canceledDocDesc + " отменен документом " + mainDocDesc, []);
	  }
    }
    /*Введение в действие*/
    var acceptedDocAssoc = ord.assocs["lecm-ord:accepted-assoc"];
    if (acceptedDocAssoc != null && acceptedDocAssoc.length > 0) {
      for (var ii = 0; ii < acceptedDocAssoc.length; ii++) {
      var acceptedDoc = acceptedDocAssoc[ii];
      acceptedDoc.addAspect("lecm-document-aspects:in-work");
      acceptedDoc.save();

      documentConnection.createConnection(ord, acceptedDoc, "accept", true, true);

      var mainDocDesc = substitude.formatNodeTitle(ord, documentScript.wrapperDocumentLink(ord, "№ {~REGNUM} от {~REGDATE}"));
      var acceptedDocDesc = substitude.formatNodeTitle(acceptedDoc, documentScript.wrapperDocumentLink(acceptedDoc, "№ {~REGNUM} от {~REGDATE}"));

	  businessJournal.log(ord.nodeRef.toString(), "ACCEPT_DOCUMENT", "Документ " + mainDocDesc + " ввел в действие документ " + acceptedDocDesc, []);
      businessJournal.log(acceptedDoc.nodeRef.toString(), "ACCEPT_DOCUMENT", "Документ " + acceptedDocDesc + " введен в действие документом " + mainDocDesc, []);
      }
    }
})();

var doc = bpm_package.children[0];
if (doc) {
  	var ordControllerAssoc = doc.assocs["lecm-ord:controller-assoc"];
    var tableAssocs = doc.assocs["lecm-ord-table-structure:items-assoc"];
    if (tableAssocs && tableAssocs.length) {
        var table = tableAssocs[0];
        if (tableAssocs && tableAssocs.length) {
            var table = tableAssocs[0];
            var pointAssocs = table.childAssocs["cm:contains"];
            if (pointAssocs && pointAssocs.length) {
                pointAssocs.forEach(function (point) {
                    var errandAssoc = point.assocs["lecm-ord-table-structure:errand-assoc"];
                    if (errandAssoc && errandAssoc.length) {
                        var pointStatusAssoc = point.assocs["lecm-ord-table-structure:item-status-assoc"];
                        if (pointStatusAssoc && pointStatusAssoc.length) {
                            var pointStatus = pointAssocs[0].properties["cm:name"];
                            if (pointStatus == "На исполнении") {
                                var errand = errandAssoc[0];
                                var errandStatus = errand.properties["lecm-statemachine:status"];
                                if (errandStatus == "Исполнено" || errandStatus == "Отменено") {
                                    if (errandStatus == "Исполнено") {
                                        pointStatus = "Исполнен";
                                    } else if (errandStatus == "Отменено") {
                                        pointStatus = "Отменен";
                                    }
                                    ordStatemachine.changePointStatus(point.nodeRef.toString(), pointStatus);
                                    var currentUser = orgstructure.getCurrentEmployee();
                                    var title = point.properties["lecm-ord-table-structure:title"];
                                    var content = point.properties["lecm-ord-table-structure:item-content"];
                                    var number = point.properties["lecm-document:indexTableRow"];
                                    if (ordControllerAssoc && ordControllerAssoc.length) {
                                        notifications.sendNotificationFromCurrentUser({
                                            recipients: [ordControllerAssoc[0]],
                                            templateCode: 'ORD_ITEM_CHANGE_STATUS',
                                            templateConfig: {
                                                mainObject: doc,
                                                eventExecutor: currentUser,
                                                number: number,
                                                numberTitle: title + " " + content,
                                                status: pointStatus,
                                                statusTitle: ""
                                            },
                                            dontCheckAccessToObject: true
                                        });
                                    }
                                }
                            }
                        }
                    }
                });
            }
        }
    }
  	var reviewState = doc.properties["lecm-review-ts:doc-review-state"];
  	var executionState = doc.properties["lecm-eds-aspect:execution-state"];
  	var confirmCompletion = doc.properties["lecm-ord:confirm-completion"];
  	if (reviewState != "IN_PROCESS" && executionState != "IN_PROCESS") {
      var ntCode = "ORD_COMPLETE";
      if (!confirmCompletion) {
        ntCode = "ORD_AUTO_COMPLETE";
        var logText = documentScript.wrapperLink(doc, "ОРД");
        logText += " автоматически переведен в статус «Работа завершена» в связи с завершением работы по документу";
      	businessJournal.log(doc.nodeRef.toString(), "COMPLETE_DOCUMENT", logText, []);
        doc.properties["lecm-ord:transit-to-work-completed"] = true;
      }
      if (ordControllerAssoc && ordControllerAssoc.length) {
        notifications.sendNotificationFromCurrentUser({
          recipients: [ordControllerAssoc[0]],
          templateCode: ntCode,
          templateConfig: {
            mainObject: doc
          },
          dontCheckAccessToObject: true
        });
      }
    }
  	doc.save();
    edsDocument.resetChildChangeSignal(doc);
}

(function(){
    var ord = stm_document;
    var controllerAssoc = ord.assocs["lecm-ord:controller-assoc"];
    if (controllerAssoc!=null && controllerAssoc.length > 0) {
        var controller = controllerAssoc[0];
        var tableAssocs = ord.assocs["lecm-ord-table-structure:items-assoc"];
        if (tableAssocs!=null && tableAssocs.length > 0){
            var table = tableAssocs[0];
            var  pointAssocs = table.childAssocs["cm:contains"];
            if (pointAssocs!=null && pointAssocs.length > 0 ){
                /* формируем поручения */
                ordStatemachine.formErrands(ord);
            }
        }

        /* выдадим права контролеру */
        statemachine.grandDynamicRoleForEmployee(ord, controller, "DA_CONTROLLER_DYN", task);

        /* рассылаем уведомление */
        notifications.sendNotification({
            recipients: controllerAssoc,
            templateCode: 'ORD_GEN_ORDERS',
            templateConfig: {
                mainObject: ord
            }
        });
    }
})();

